ent: string; // Corrected to match structure\n}\n\nexport interface BilanBiologique {\n  description : string;\n}\n\nexport interface BilanRadiologique {\n  description : string;\n  type : string;\n}\n\nexport interface Consultation {\n  nss: string;\n  resume: Resume;\n  ordonnance : Ordonnance;\n  bilan_biologique: BilanBiologique;\n  bilan_radiologue: BilanRadiologique;\n}\n\n    \n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"injectables/ConsultationApiService.html":{"url":"injectables/ConsultationApiService.html","title":"injectable - ConsultationApiService","body":"\n                   \n\n\n\n\n\n\n\n\n\n  Injectables\n  ConsultationApiService\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            src/app/services/consultation-api.service.ts\n        \n\n\n\n\n\n            \n    Index\n    \n        \n                \n                    \n                        Properties\n                    \n                \n                \n                    \n                        \n                            \n                                    Private\n                                apiUrl\n                            \n                        \n                    \n                \n\n                \n                    \n                        Methods\n                    \n                \n                \n                    \n                        \n                            \n                                ajouterConsultation\n                            \n                        \n                    \n                \n\n\n\n\n\n        \n    \n\n\n            \n    Constructor\n        \n            \n                \n                    \nconstructor(http: HttpClient)\n                    \n                \n                        \n                            \n                                Defined in src/app/services/consultation-api.service.ts:11\n                            \n                        \n\n                \n                    \n                            \n                                    Parameters :\n                                    \n                                        \n                                            \n                                                Name\n                                                    Type\n                                                Optional\n                                            \n                                        \n                                        \n                                                \n                                                        http\n                                                  \n                                                        \n                                                                    HttpClient\n                                                        \n                                                  \n                                                    \n                                                            No\n                                                    \n                                                    \n                                                \n                                        \n                                    \n                            \n                    \n                \n            \n        \n\n\n            \n    \n    \n        Methods\n    \n    \n        \n            \n                \n                    \n                    \n                        ajouterConsultation\n                        \n                    \n                \n            \n            \n                \najouterConsultation(consultation: Consultation)\n                \n            \n\n\n                    \n                        \n                            Defined in src/app/services/consultation-api.service.ts:15\n                        \n                    \n\n\n            \n                \n\n                            \n                                Parameters :\n                                \n                                \n                                    \n                                        \n                                            Name\n                                                Type\n                                            Optional\n                                        \n                                    \n                                    \n                                        \n                                                consultation\n                                            \n                                                            Consultation\n                                            \n\n                                            \n                                                    No\n                                            \n\n\n                                        \n                                    \n                                \n                            \n                        \n                            Returns :     Observable\n\n                        \n                            \n                                \n                            \n                \n            \n        \n    \n\n            \n    \n    \n        Properties\n    \n    \n        \n            \n                \n                    \n                    \n                            Private\n                        apiUrl\n                        \n                    \n                \n            \n                \n                    \n                        Type :         string\n\n                    \n                \n                \n                    \n                        Default value : 'http://127.0.0.1:8000/api/miseajourdpi/ajouterConsultation/'\n                    \n                \n                    \n                        \n                                Defined in src/app/services/consultation-api.service.ts:11\n                        \n                    \n\n\n        \n    \n\n\n    \n\n\n    \n        import { Injectable } from '@angular/core';\nimport { HttpClient } from '@angular/common/http';\nimport { Observable } from 'rxjs';\nimport { Consultation } from '../models/consultation.model';\nimport { HttpHeaders } from '@angular/common/http';\n\n@Injectable({\n  providedIn: 'root',\n})\nexport class ConsultationApiService {\n  private apiUrl = 'http://127.0.0.1:8000/api/miseajourdpi/ajouterConsultation/';\n\n  constructor(private http: HttpClient) {}\n\n  ajouterConsultation(consultation : Consultation): Observable {\n    const headers = new HttpHeaders({\n        'Content-Type': 'application/json' // Set Content-Type to JSON\n      });\n    return this.http.post(this.apiUrl, consultation, { headers: headers })\n  }\n}\n\n    \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"interfaces/ConsultationData.html":{"url":"interfaces/ConsultationData.html","title":"interface - ConsultationData","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n  Interfaces\n  \n  ConsultationData\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            src/app/services/consulter-dpi.service.ts\n        \n\n\n\n\n        \n            Index\n            \n                \n                    \n                        \n                            Properties\n                        \n                    \n                    \n                        \n                            \n                                \n                                        \n                                            bilan_biologique\n                                        \n                                \n                                \n                                        \n                                            bilan_radiologique\n                                        \n                                \n                                \n                                        \n                                            date_consult\n                                        \n                                \n                                \n                                        \n                                            id_consult\n                                        \n                                \n                                \n                                        \n                                            ordonnance\n                                        \n                                \n                                \n                                        \n                                            resume\n                                        \n                                \n                            \n                        \n                    \n                \n            \n        \n\n\n\n            \n                Properties\n                    \n                        \n                                \n                                    \n                                        \n                                        bilan_biologique\n                                            \n                                                \n                                            \n                                        \n                                    \n                                \n                                \n                                    \n                                        bilan_biologique:         boolean\n\n                                    \n                                \n\n\n                                    \n                                        \n                                            Type :         boolean\n\n                                        \n                                    \n\n\n\n\n\n                        \n                    \n                    \n                        \n                                \n                                    \n                                        \n                                        bilan_radiologique\n                                            \n                                                \n                                            \n                                        \n                                    \n                                \n                                \n                                    \n                                        bilan_radiologique:         boolean\n\n                                    \n                                \n\n\n                                    \n                                        \n                                            Type :         boolean\n\n                                        \n                                    \n\n\n\n\n\n                        \n                    \n                    \n                        \n                                \n                                    \n                                        \n                                        date_consult\n                                            \n                                                \n                                            \n                                        \n                                    \n                                \n                                \n                                    \n                                        date_consult:         string\n\n                                    \n                                \n\n\n                                    \n                                        \n                                            Type :         string\n\n                                        \n                                    \n\n\n\n\n\n                        \n                    \n                    \n                        \n                                \n                                    \n                                        \n                                        id_consult\n                                            \n                                                \n                                            \n                                        \n                                    \n                                \n                                \n                                    \n                                        id_consult:         number\n\n                                    \n                                \n\n\n                                    \n                                        \n                                            Type :         number\n\n                                        \n                                    \n\n\n\n\n\n                        \n                    \n                    \n                        \n                                \n                                    \n                                        \n                                        ordonnance\n                                            \n                                                \n                                            \n                                        \n                                    \n                                \n                                \n                                    \n                                        ordonnance:         boolean\n\n                                    \n                                \n\n\n                                    \n                                        \n                                            Type :         boolean\n\n                                        \n                                    \n\n\n\n\n\n                        \n                    \n                    \n                        \n                                \n                                    \n                                        \n                                        resume\n                                            \n                                                \n                                            \n                                        \n                                    \n                                \n                                \n                                    \n                                        resume:         boolean\n\n                                    \n                                \n\n\n                                    \n                                        \n                                            Type :         boolean\n\n                                        \n                                    \n\n\n\n\n\n                        \n                    \n            \n    \n\n\n    \n        import { Injectable } from '@angular/core';\nimport exp from 'constants';\nimport { Observable,of } from 'rxjs';\nimport {  HttpClient, HttpParams } from '@angular/common/http';\nimport { map } from 'rxjs/operators';\n\nexport interface ListConsultation {\n  date: string;\n  NConsultation: number;\n  Ordo:string;\n  Bilan_bio:string;\n  Bilan_rad:string;\n  Resume: string;\n}\n\nexport interface ListMeds {\n  medicament : string ;\n  dose : string ;\n  duree : string ;\n  \n  }\n\n  export interface ListSoins {\n    Date:String;\n    Description:string;\n    Observation:string;\n  }\n  export interface SoinsData{\n    description:string;\n    date_soin: string;\n    observation: string ;\n  }\n  export interface ConsultationData {\n    id_consult: number;\n    date_consult: string;\n    ordonnance: boolean;\n    bilan_biologique: boolean;\n    bilan_radiologique: boolean;\n    resume: boolean;\n  }\n  \n  export interface DpiDetails {\n    nss: string;\n    nom_patient: string;\n    prenom_patient: string;\n    date_de_naissance: string; // You can use `Date` type if you need a Date object instead of string\n    adresse: string;\n    telephone: string;\n    mutuelle: string;\n    personne_a_contacter: string;\n    nom_complet_medecin: string;\n    id_dpi: string  ;\n  }\n@Injectable({\n  providedIn: 'root'\n})\nexport class ConsulterDpiService {\n  \n  private apiUrl = 'http://127.0.0.1:8000/api/miseajourdpi/getConsultations/';\n  private soinsurl = 'http://127.0.0.1:8000/api/miseajourdpi/getSoins/';\n  private resumesurl = 'http://127.0.0.1:8000/api/miseajourdpi/getResume/';\n  private ordourl = 'http://127.0.0.1:8000/api/miseajourdpi/getOrdonnance/';\n  private bilanbiourl = 'http://127.0.0.1:8000/api/biology';\n  private bilanradurl = 'http://127.0.0.1:8000/api/radiology';\n  private infourl = 'http://127.0.0.1:8000/api/dpi/consulterdpi'\n\n  constructor(private http: HttpClient) { }\n/*\n  getListConsultation(dpi: number):Observable{\n    const params = new HttpParams().set('dpi', dpi.toString());\n    return  this.http.get(this.apiUrl, { params });\n  }*/\n    getDpiDetails(id: string): Observable {\n      return this.http.get(`${this.infourl}/${id}/`);\n    }\n    getListConsultation(dpi: number): Observable {\n      const params = new HttpParams().set('dpi', dpi);\n      console.log(\"hi\");\n      return this.http.get(this.apiUrl, { params }).pipe(\n        map((data: ConsultationData[]) => \n          data.map(consultation => ({\n            NConsultation: consultation.id_consult,        // num_consult -> NConsultation\n            date: consultation.date_consult,                // date_consult -> date\n            Ordo: consultation.ordonnance ? 'oui' : 'non',  // ordonnance -> Ordo (oui/non)\n            Bilan_bio: consultation.bilan_biologique ? 'oui' : 'non',                             // Utiliser vos propres donnes pour Bilan_bio\n            Bilan_rad: consultation.bilan_radiologique ? 'oui' : 'non',                              // Utiliser vos propres donnes pour Bilan_rad\n            Resume: consultation.resume ? 'oui' : 'non'    // resume -> Resume (oui/non)\n          }))\n        )\n      ); \n    }\n\n    getResume(id_consult: number): Observable {\n      const params = new HttpParams().set('id_consult', id_consult);\n      return this.http.get(this.resumesurl, { params });\n    } \n    \n    \n  getListMeds(id_consult: number):Observable{\n    const params = new HttpParams().set('id_consult', id_consult);\n      return this.http.get(this.ordourl, { params }).pipe(\n        map((data: ListMeds[]) => \n          data.map(med => ({\n            medicament: med.medicament,       \n            dose: med.dose,               \n            duree: med.duree ,  \n          }))\n        )\n      );\n  }\n  getBilanBiologiquesByIdConsult(id_consult: number): Observable {\n    return this.http.get(`${this.bilanbiourl}/dpi/${id_consult}/biobilansparconsult/`);\n  }\n\n  getBilanRadiologiquesByIdConsult(id_consult: number): Observable {\n    return this.http.get(`${this.bilanradurl}/dpi/${id_consult}/bilanparconsult/`);\n  }\n  getListSoins(dpi: number):Observable{\n      const params = new HttpParams().set('dpi', dpi);\n      return this.http.get(this.soinsurl, { params }).pipe(\n        map((data: SoinsData[]) => \n          data.map(soin => ({\n            Description: soin.description,       \n            Date: soin.date_soin,               \n            Observation: soin.observation ,  \n          }))\n        )\n      );\n  }\n \n}\n\n    \n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"components/ConsultationHomeComponent.html":{"url":"components/ConsultationHomeComponent.html","title":"component - ConsultationHomeComponent","body":"\n                   \n\n\n\n\n\n  Components\n  \n  ConsultationHomeComponent\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n        \n            Template\n        \n        \n            Styles\n        \n        \n            DOM Tree\n        \n\n\n\n    \n    File\n\n\n    src/app/consultation-home/consultation-home.component.ts\n\n\n\n\n\n    \n        Implements\n    \n    \n                OnInit\n    \n\n\n\n    Metadata\n    \n        \n\n\n\n\n\n\n\n\n\n\n\n\n            \n                selector\n                app-consultation-home\n            \n\n\n            \n                imports\n                \n                                HeaderComponent\n                            CommonModule\n                \n            \n\n            \n                styleUrls\n                ./consultation-home.component.css\n            \n\n\n\n            \n                templateUrl\n                ./consultation-home.component.html\n            \n\n\n\n\n\n\n\n\n        \n    \n\n\n    \n    Index\n    \n        \n                \n                    \n                        Properties\n                    \n                \n                \n                    \n                        \n                            \n                                consultation\n                            \n                            \n                                modalMessage\n                            \n                            \n                                showModal\n                            \n                            \n                                showWarning\n                            \n                        \n                    \n                \n\n                \n                    \n                        Methods\n                    \n           